const Layout = (props) => {
    const { children } = props
    return (
        <div
            style={{
                backgroundColor: 'red',
                width: 930,
                margin: '0 auto'
            }}
        >
            <div
                style={{
                    backgroundColor: 'blue'
                }}
            >
                <div>logo</div>

            </div>
            {children}
        </div>
    )
}

export default Layout
